import React from 'react'
import {LazyLoadImage} from "react-lazy-load-image-component";
import 'react-lazy-load-image-component/src/effects/blur.css'
import content from '../content'
import Typical from 'react-typical'


export default function Header() {
    return (
        <div className="min-h-screen flex items-center justify-center" style={{
            backgroundColor: "#091c29"
        }}>

            <div>
                <div>
                    <LazyLoadImage src={content.header.img} effect="blur"/>
                </div>

                <div className="text-white font-dosis text-center">
                    <h2 className="text-3xl font-bold">{content.header.text[0]} <br/>
                        {content.header.text[1]} <br/>
                    </h2>
                    <h1 className="font-bold text-2xl text-gray-500">{content.header.text[2]}
                        <Typical
                            steps={content.header.typical}
                            loop={Infinity}
                            className="inline-block"
                        />
                    </h1>

                    <button className="bg-indigo-500 px-10 py-3 text-xl uppercase mt-10 rounded-lg">{content.header.btnText}</button>
                </div>
            </div>
        </div>
    );
}
